import React from 'react';

function SearchResults({ tracks }) {
  return (
    <div>
      {tracks.map(track => (
        <div key={track.id} className="Track">
          <h4 className="SongName">{track.name}</h4>
          <p className="SongInfo">
            {track.artists.join(', ')} | {track.album}
          </p>
        </div>
      ))}
    </div>
  );
}

export default SearchResults;
